import React, { useState } from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button, Col
} from 'reactstrap';

import './style.css';
import api from '../../services/api';

const Content = () =>{

    return (
      <>
      {api.content.body.map((value, index) => {
                return <Col xs="12" sm="6" key={index}>
                <Card className="card">
                  <CardImg top width="100%" src="../../img/chocomel.png"alt="Card image cap" className="cardImg"/>
                  <CardBody className="cardBody">
                    <CardTitle className="cardTitle">{value.title}</CardTitle>
                    <CardSubtitle className="cardSubTitle">{value.subtitle}</CardSubtitle>
                    <div className="cardButton">> {value.button}</div>
                  </CardBody>
                </Card>
                </Col>
              })}

    </>
    )
}

export default Content;
